// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Container, Nav } from 'react-bootstrap';

const Header = ({ isAuthenticated }) => {
  return (
    <Navbar bg="light" expand="lg" fixed="top" className="shadow-sm">
      <Container>
      <Navbar.Brand as={Link} to="/" className="d-flex align-items-center">
        <img 
          src="/images/logo5.png" 
          alt="HTU Logo" 
          style={{ 
            height: '60px',          // Reasonable logo height
            padding: '5px 0',       // Vertical padding
            filter: 'brightness(0)'  // If you want to change color (optional)
          }} 
        />
      </Navbar.Brand>
              
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto align-items-center">
            <Nav.Link as={Link} to="/report-accident" className="me-3">
              Report
            </Nav.Link>
            
            {isAuthenticated ? (
              <Nav.Link as={Link} to="/dashboard" className="btn btn-outline-secondary me-3">
                Dashboard
              </Nav.Link>
            ) : (
              <>
                <Nav.Link as={Link} to="/login" className="btn btn-outline-secondary me-3">
                  Login
                </Nav.Link>
                <Nav.Link as={Link} to="/signup" className="btn btn-primary me-3">
                  Sign Up
                </Nav.Link>
              </>
            )}
            
            <Nav.Link as={Link} to="/account" className="active">
              Account
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
